import React from "react";

const Footer = () => {

    const footcss = {
        backgroundcolor: "#000000",
        padding: "10px",
    }
  return (
    <div>
      <section style={ footcss }>
        <div style={{ textAlign: "center" }}>
          <span style={{ color: "#01579B" }}>&copy Semicolons</span>
        </div>
      </section>
    </div>
  );
};

export default Footer;
